import React from 'react';

const TabBar = () => {
  return (
    <div className="TabBar">
      <ul class="list-inline">
        <li class="active"><a href="#">Coches</a></li>
        <li><a href="#">Packages</a></li>
      </ul>
    </div>
  );
};

export default TabBar;
